import React from "react";
import axios from "axios";

export const ApiListCall = () => {
    axios.get('http://localhost:8000/api/blog/list/',{
    headers: {
        'Authorization': `Bearer ${localStorage.getItem('accessToken')}`
    }
    }).then((response)=>{
        console.log(respons.data);
    }).catch((e)=>{
        console.log(e);
    })
}
